import React from "react";

import "./button.scss";
import { CustomButtonContainer } from "./button.styles";

const CustomButton = ({
  children,
  isGoogleSignIn,
  reversed,
  ...otherProps
}) => <bCustomButtonContainer>{children}</bCustomButtonContainer>;

export default CustomButton;
